[package]
name = "leptos_icons"
version = "0.0.4"
authors = ["Charles Edward Gagnon", "Bruno De Simone", "Lukas Potthast"]
edition = "2021"
description = "Component library providing a variety of icons for the leptos web framework."
readme = "./README.md"
repository = "https://github.com/Carlosted/leptos-icons"
license = "MIT"
keywords = ["icons", "leptos"]
categories = ["web-programming"]

# See more keys and their definitions at https://doc.rust-lang.org/cargo/reference/manifest.html

[dependencies]
leptos = { version = "0.2.5", default-features = false }
tracing = "0.1"

icondata_core = "0.0.1"
icondata_ai = { version = "0.0.2", optional = true }
icondata_fa = { version = "0.0.2", optional = true }
icondata_wi = { version = "0.0.2", optional = true }
icondata_fi = { version = "0.0.2", optional = true }
icondata_vs = { version = "0.0.2", optional = true }
