icondata_im = { version = "0.0.2", optional = true }
icondata_io = { version = "0.0.2", optional = true }
icondata_ri = { version = "0.0.2", optional = true }
icondata_si = { version = "0.0.2", optional = true }
icondata_ti = { version = "0.0.2", optional = true }
icondata_hi = { version = "0.0.2", optional = true }
icondata_cg = { version = "0.0.2", optional = true }
icondata_tb = { version = "0.0.2", optional = true }
icondata_oc = { version = "0.0.2", optional = true }
icondata_lu = { version = "0.0.2", optional = true }


[features]
default = []
csr = ["leptos/csr"]
hydrate = ["leptos/hydrate"]
ssr = ["leptos/ssr"]
stable = ["leptos/stable"]
tracing = ["leptos/tracing"]
